import React from 'react';
import { Form, Input, Button, Typography } from 'antd';
import { UserOutlined, LockOutlined } from '@ant-design/icons';
import CenterCardLayout from '../layouts/CenterCardLayout';

const { Title } = Typography;

const Login = () => (
  <CenterCardLayout width={400}>
    <Title level={2} style={{ textAlign: 'center', marginBottom: 32 }}>Login</Title>
    <Form>
      <Form.Item name="username" rules={[{ required: true, message: '请输入用户名！' }]}>
        <Input prefix={<UserOutlined />} placeholder="UserName" size="large" />
      </Form.Item>
      <Form.Item name="password" rules={[{ required: true, message: '请输入密码！' }]}>
        <Input.Password prefix={<LockOutlined />} placeholder="UserPassword" size="large" />
      </Form.Item>
      <Form.Item>
        <Button type="primary" htmlType="submit" block size="large" style={{
          borderRadius: 24,
          background: 'linear-gradient(90deg, #ff758c 0%, #ff7eb3 100%)',
          border: 'none'
        }}>
          Sign in
        </Button>
      </Form.Item>
    </Form>
  </CenterCardLayout>
);

export default Login;
